import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import { FaUser, FaSignOutAlt, FaSignInAlt, FaUserPlus, FaCog, FaApple, FaLeaf, FaHeart, FaChevronDown } from 'react-icons/fa';

const Navbar = () => {
  const { user, isAuthenticated, logout } = useAuth();
  const navigate = useNavigate();
  const [activeCategory, setActiveCategory] = useState(null);
  const [showSubcategories, setShowSubcategories] = useState({});

  const categories = [
    {
      name: 'Workout & Sports',
      color: '#FF8C42',
      subcategories: ['Pre - K - 2', 'Grades 3 - 4', 'Grades 5 - 8', 'HighSchool']
    },
    {
      name: 'Dance & Move', 
      color: '#4ECDC4',
      subcategories: ['Pre - K - 2', 'Grades 3 - 4', 'Grades 5 - 8', 'HighSchool']
    },
    {
      name: 'Yoga',
      color: '#96CEB4', 
      subcategories: ['Pre - K - 2', 'Grades 3 - 4', 'Grades 5 - 8', 'HighSchool']
    },
    {
      name: 'Mindfulness',
      color: '#45B7D1',
      subcategories: ['Pre - K - 2', 'Grades 3 - 4', 'Grades 5 - 8', 'HighSchool']
    },
    {
      name: 'Saved Videos',
      color: '#F7931E',
      subcategories: []
    }
  ];

  const toggleSubcategories = (categoryName) => {
    setShowSubcategories(prev => ({
      ...prev,
      [categoryName]: !prev[categoryName]
    }));
  };

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  return (
    <nav style={{
      background: 'rgba(255, 255, 255, 0.1)',
      backdropFilter: 'blur(10px)',
      borderBottom: '1px solid rgba(255, 255, 255, 0.2)',
      padding: '1rem 2rem',
      position: 'sticky',
      top: 0,
      zIndex: 100
    }}>
      <div style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        maxWidth: '1200px',
        margin: '0 auto'
      }}>
        {/* Logo */}
        <Link to="/" style={{ textDecoration: 'none', color: 'white', display: 'flex', alignItems: 'center', gap: '10px' }}>
          <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
            <FaApple style={{ color: '#FF8C42', fontSize: '2rem' }} />
            <FaLeaf style={{ color: '#4ECDC4', fontSize: '2rem' }} />
            <FaHeart style={{ color: '#96CEB4', fontSize: '2rem' }} />
          </div>
          <div>
            <div style={{ 
              fontSize: '1.2rem', 
              fontWeight: 'bold',
              color: '#D4AF37',
              textTransform: 'uppercase',
              letterSpacing: '1px',
              lineHeight: '1.2'
            }}>
              WELLNESS <span style={{ color: '#B8860B' }}>IN</span>
            </div>
            <div style={{ 
              fontSize: '1.2rem', 
              fontWeight: 'bold',
              color: '#D4AF37',
              textTransform: 'uppercase',
              letterSpacing: '1px',
              lineHeight: '1.2'
            }}>
              THE <span style={{ color: '#B8860B' }}>SCHOOLS</span>
            </div>
          </div>
        </Link>

        {/* Navigation Links */}
        <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
          {isAuthenticated ? (
            <>
              {/* User Menu */}
              <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
                <span style={{ color: 'rgba(255, 255, 255, 0.8)' }}>
                  Welcome, {user?.username}!
                </span>

                {/* Profile Link */}
                <Link to="/profile" className="btn btn-secondary" style={{ padding: '8px 16px', fontSize: '0.9rem' }}>
                  <FaUser style={{ marginRight: '0.5rem' }} />
                  Profile
                </Link>

                {/* Admin Link (if admin) */}
                {user?.role === 'admin' && (
                  <Link to="/admin" className="btn btn-success" style={{ padding: '8px 16px', fontSize: '0.9rem' }}>
                    <FaCog style={{ marginRight: '0.5rem' }} />
                    Admin
                  </Link>
                )}

                {/* Logout Button */}
                <button onClick={handleLogout} className="btn btn-danger" style={{ padding: '8px 16px', fontSize: '0.9rem' }}>
                  <FaSignOutAlt style={{ marginRight: '0.5rem' }} />
                  Logout
                </button>
              </div>
            </>
          ) : (
            <>
              {/* Login Link */}
              <Link to="/login" className="btn btn-primary" style={{ padding: '8px 16px', fontSize: '0.9rem' }}>
                <FaSignInAlt style={{ marginRight: '0.5rem' }} />
                Login
              </Link>

              {/* Register Link */}
              <Link to="/register" className="btn btn-secondary" style={{ padding: '8px 16px', fontSize: '0.9rem' }}>
                <FaUserPlus style={{ marginRight: '0.5rem' }} />
                Register
              </Link>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
